    false,nt"url": null,nt"notes": "NODC Accession 0100068 includes chemical,
    physical, time series and underway - surface data collected from MOORINGS in the
    Gulf of Mexico from 2009-05-12 to 2009-12-21. These data include CARBON DIOXIDE
    - AIR, CARBON DIOXIDE - PARTIAL PRESSURE (pCO2), CARBON DIOXIDE - PARTIAL PRESSURE
    - DIFFERENCE, OXYGEN - PERCENT SATURATION, SALINITY and SEA SURFACE TEMPERATURE.
    The instruments used to collect these data include Carbon dioxide (CO2) gas analyzer
    and Carbon dioxide (CO2) laminar flow bubble equilibrator (for buoy measurement).nnThese
    data were collected by Christopher Sabine, Adrienne J. Sutton and Stacy Maenner
